import React, { useContext } from "react";
//GENERAL
import { FormControl,InputLabel,MenuItem ,Select,TextField, Grid } from "@material-ui/core";

import { isWidthDown } from "@material-ui/core/withWidth";
//CONTEXT
import { ApplicantContext } from "./ApplicantContext";

export default props => {
  const [state] = useContext(ApplicantContext);
  const { user, errors } = state;
  const dateLimit = new Date();
  dateLimit.setFullYear(dateLimit.getFullYear() - 18);
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} lg={2}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Salutation</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={user.salutation}
        >
          <MenuItem value={'Mr'}>Mr.</MenuItem>
          <MenuItem value={'Miss'}>Miss</MenuItem>
          <MenuItem value={'Mrs'}>Mrs</MenuItem>
          <MenuItem value={'Madam'}>Madam</MenuItem>
          <MenuItem value={'Dr'}>Dr</MenuItem>
          <MenuItem value={'Prof'}>Prof</MenuItem>
        </Select>
      </FormControl>
      </Grid>
      <Grid item xs={12} lg={3}>
        <TextField
          placeholder='Type your Surname here'
          name='last_name'
          label='Surname'
          value={user.last_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          required
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["surname"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={3}>
        <TextField
          placeholder='Type your firstname here'
          name='first_name'
          label='Firstname'
          value={user.first_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          required
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["firstname"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={4}>
        <TextField
          placeholder='Type your othername here'
          name='middle_name'
          label='Othername'
          value={user.middle_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          required
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["othername"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your email here'
          name='email'
          label='Email'
          value={user.student_email}
          type='email'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["email"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your phone here'
          name='student_mobile_number'
          label='Phone'
          value={user.student_mobile_number}
          type='email'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_mobile_number"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12}>
        <TextField
          type='date'
          name='birthdate'
          id='birthdate'
          label='Birthdate'
          defaultValue={user.birthdate}
          helperText='You need to be at least 18 years old'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          inputProps={{
            min: "1920-01-01",
            max: dateLimit.toISOString().slice(0, 10)
          }}
          error={!!errors["birthdate"]}
          required
          fullWidth={isWidthDown("sm")}
        />
      </Grid>

      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your password here'
          name='password'
          label='Password'
          type='password'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          required
          error={!!errors["password"]}
          inputProps={{
            minLength: 6,
            maxLength: 20
          }}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Re-type your password here'
          label='Password'
          name='confirmPassword'
          type='password'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["confirmPassword"]}
          inputProps={{
            minLength: 6,
            maxLength: 20
          }}
          required
          fullWidth
        />
      </Grid>
    </Grid>
  );
};
